import Register from "./pages/register/Register.jsx";
import Login from "./pages/login/Login.jsx"
import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

const App = () => {
  const router = createBrowserRouter([
    {
      path: "/login",
      element: <Login />,
    },
    {
      path: "/register",
      element: <Register />,
    }
  ]

  )
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
};

export default App;
